from collections import deque

def move(key, instr):
    if instr == 'L':
        if key in [1, 2, 5, 10, 13]:
            return key
        else:
            return key - 1
    elif instr == 'R':
        if key in [1, 4, 9, 12, 13]:
            return key
        else:
            return key + 1
    elif instr == 'D':
        if key in [5, 9, 10, 12, 13]:
            return key
        elif key in [1, 11]:
            return key + 2
        else:
            return key + 4
    elif instr == 'U':
        if key in [1, 2, 4, 5, 9]:
            return key
        elif key in [3, 13]:
            return key - 2
        else:
            return key - 4
    else:
        raise Exception

def findKey(key, instructions):
    if len(instructions) == 0:
        return key
    newKey = move(key, instructions.popleft())

    return findKey(newKey, instructions)

def main():
    #instructions = ['ULL', 'RRDDD', 'LURDL', 'UUUUD']
    instructions = ['', '', '', '', '']
    key = 5
    for i in instructions:
        converted = deque(i)
        key = findKey(key, converted)
        print(hex(key))

if __name__ == "__main__":
    main()
